import "./App.css";
import Nav from "./nav";
import { BrowserRouter,Routes } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
        <Nav />
        <h1>Node js project</h1>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
